import React, { useState, useEffect } from "react";
import "../styles/UserPage.css";

const UserPage = () => {
  const [userData, setUserData] = useState({
    name: "User Name",
    groupName: "Group Name",
    semigroupName: "Semigroup Name",
  });

  const [leadership, setLeadership] = useState({
    groupLeader: "Group Leader Name",
    sysAdmin: "Sys Admin Name",
    semigroupCoordinator: "Semigroup Coordinator Name",
    secretary: "Secretary Name and Phone No.",
  });

  const [notifications, setNotifications] = useState([
    "GroupLeader added a new poll!",
    "SysAdmin added a new form!",
    "Information added!",
  ]);

  const [deadlines, setDeadlines] = useState([
    { date: "Fri 13", task: "Upload a form" },
    { date: "Wed 18", task: "Participate in poll" },
  ]);

  return (
    <div className="user-page">
      <div className="top-bar">
        <img src="/logo.png" alt="Nexus Logo" className="logo" />
        <nav>
          <span>My account</span>
          <span>Messages</span>
        </nav>
      </div>
      <div className="content">
        <div className="profile-section">
          <div className="profile-pic"></div>
          <div className="user-info">
            <strong>Name:</strong> {userData.name} <br />
            <strong>Group name:</strong> {userData.groupName} <br />
            <strong>Semigroup name:</strong> {userData.semigroupName}
          </div>
        </div>
        <div className="leadership-info">
          <strong>Group leader:</strong> {leadership.groupLeader} <br />
          <strong>Sys admin:</strong> {leadership.sysAdmin} <br />
          <strong>Semigroup coordinator:</strong> {leadership.semigroupCoordinator} <br />
          <strong>Secretary:</strong> {leadership.secretary}
        </div>
        <div className="notifications">
          <h3>Notifications</h3>
          {notifications.length > 0 ? (
            <ul>
              {notifications.map((note, index) => (
                <li key={index}>{note}</li>
              ))}
            </ul>
          ) : (
            <p>No new notifications</p>
          )}
        </div>
        <div className="tasks">
          <h3>Timeline</h3>
          {deadlines.map((task, index) => (
            <div key={index} className="task">
              <strong>{task.date}</strong> - {task.task}
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default UserPage;
